// src/components/UserProfileCard.js
import React from 'react';
import { Card, CardHeader, CardContent, Typography, Grid } from '@mui/material';

const UserProfileCard = () => {
  return (
    <Card>
      {/* Profile picture as the header */}
      <CardHeader
        title={<img src="profile-picture.jpg" alt="Profile" style={{ width: '100%', height: 'auto' }} />}
        // Removing subheader
        sx={{ textAlign: 'center' }}
      />
      <CardContent>
        <Grid container spacing={2}>
          {/* First column */}
          <Grid item xs={6}>
            <Typography variant="body1">Name: </Typography>
            <Typography variant="body1">Email: </Typography>
            <Typography variant="body1">Business Type: </Typography>
            <Typography variant="body1">Phone Number: </Typography>
          </Grid>
          {/* Second column */}
          <Grid item xs={6}>
          <Typography variant="body1">Phone Number: </Typography>
            <Typography variant="body1">Company: </Typography>
            <Typography variant="body1">Expected Credit: </Typography>
            <Typography variant="body1">Number of Employees: </Typography>
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
};

export default UserProfileCard;
